@bukoug go choke on a dick :D

More seriously, sex is determined by DNA. That's something you can't really get changed (yet). Gender (how your mind subconsciously views your own gender role) is determined by a combination of hormones your brain is exposed to in utero. In other words, hormones you receive from yourself and partly from your mother... a portion which your DNA has no control over. And they don't always get deployed correctly. About 1 in 250 get deployed wrong, and bam: another transperson is born and suffers until they get fixed. Still think it's all in our heads? Then consider why there's almost as many trans people in America as there are people with type 1 diabetes. That's a bit too many to fall in the "oh you're just imagining it" category. And if you still insist we just 'ignore it', then you're asking us to die. Cause that's what happens if you ignore it, you lose your will to live.

